import React from "react";
import { Link } from "react-router-dom";

function SiteHeader({ actionLabel = "Добавить аналитику", actionTo = "/posts/new" }) {
  return (
    <header className="main-header glass-panel">
      <div className="container wide header-grid">
        <div>
          <Link to="/" className="logo">EstatePulse</Link>
          <p className="logo-subtitle">новости рынка недвижимости</p>
        </div>
        <nav className="main-nav">
          <button type="button" className="ghost-link">Рынок РК</button>
          <button type="button" className="ghost-link">Астана</button>
          <button type="button" className="ghost-link">Алматы</button>
          <button type="button" className="ghost-link">Шымкент</button>
          {actionLabel && actionTo && (
            <Link to={actionTo} className="btn btn-primary nav-cta">
              {actionLabel}
            </Link>
          )}
        </nav>
      </div>
    </header>
  );
}

export default SiteHeader;
